import React from "react";
import propTypes from "prop-types";
import styles from "./ContactListItem.module.css";
// import withHigherOrderComponent from "../hoc/withHigherOrderComponent";

const ContactListItem = ({ name, number, onRemoveContact }) => {
  return (
    <li className={styles.item}>
      <p>
        {name}: {number}
      </p>
      <button type="button" className={styles.button} onClick={onRemoveContact}>
        Delete
      </button>
    </li>
  );
};

ContactListItem.propTypes = {
  name: propTypes.string.isRequired,
  number: propTypes.string.isRequired,
  onRemoveContact: propTypes.func.isRequired,
};

export default withHigherOrderComponent(ContactListItem);
